            <div>{props.match.a}</div>
            <div>@</div>
            <div>{props.match.h}</div>
        </div>
    </Layout>
);

Match.getInitialProps = async function() {
    const data = SeasonSchedules;

    const match = data.find(entry => entry.est === [props.id]);

    return {match};
};

export default Post;
